def findAnagrams(s, p):
    import collections
    dict_p = collections.Counter(p)
    d = collections.Counter()
    length = len(p)
    print (len(s)," ",len(p))
    output = []
    for i in range (len(s)):
        d[s[i]] +=1
        if i >= length:
            if d[s[i - length]] ==1:
                del d[s[i - length]]
            else :
                d[s[i - length]] -=1
        if dict_p ==d:
            output.append(i-length +1)
    return output

a = "cbaebabacd"
b = "abc"
